'\\n' === l &amp;&amp; s) {\n                if ('\\r' === p) row[i] = row[i].slice(0, -1);\n                row = ret[++r] = [l = '']; i = 0;\n            } else row[i] += l;\n            p = l;\n        }\n        return ret;\n    };\n    \n    let obj = csvToArray(atob(this.value).trim())\n    \n    let len = obj.length - 1\n    \n    //transpose\n    obj = obj[0].map((col, i) =&gt; obj.map(([...row]) =&gt; row[i]))\n    \n    let df_custom = {}\n    \n    for (var ob of obj) {\n    \n        if (!(ob[0] in all_names_dict)) continue\n                \n        let name = all_names_dict[ob[0]]\n        \n        if (!original_columns.includes(name)) continue\n                \n        let sl = ob.slice(1)\n        \n        if (name!='name' &amp;&amp; name!='Class' &amp;&amp; name!='ref')\n            sl = sl.map(parseFloat)\n    \n        df_custom[name] = sl    \n    }\n    \n    for (var name of original_columns) {\n       \n        if (name in df_custom) continue\n        \n        if (name!='name' &amp;&amp; name!='Class' &amp;&amp; name!='ref')\n            df_custom[name] = Array(len).fill(NaN)\n        else \n            df_custom[name] = Array(len).fill('')        \n    }\n    \n    for (var f of color_features) {\n    \n        var s = f.split('-')\n        \n        df_custom[f] = df_custom[s[0]].map(function (v, i) { return v - df_custom[s[1]][i]; })\n    \n    }\n    \n    function hr(a, b) {\n    \n        let c = a + b\n        \n        if (c==0) return NaN    \n    \n        return (a - b) / c;\n    };\n    \n    df_custom['HR_ms'] = df_custom['F_m'].map(function (v, i) { return hr(v, df_custom['F_s'][i]); })\n    df_custom['HR_hm'] = df_custom['F_h'].map(function (v, i) { return hr(v, df_custom['F_m'][i]); })\n    df_custom['HR_hms'] = df_custom['F_h'].map(function (v, i) { return hr(v, df_custom['F_m'][i] + df_custom['F_s'][i]); })\n    \n    df_custom['F_x/F_o'] = df_custom['F_b'].map(function (v, i) { \n        return Math.log10(v) + 5 - Math.log10(1.65) + df_custom['G'][i] / 2.5; })\n            \n    df_custom['Class'] = df_custom['Class'].map(x =&gt; x.replace('ATNF', 'NS'))\n    df_custom['Class'] = df_custom['Class'].map(x =&gt; x.replace('ATNF_BIN', 'NS_BIN'))\n    \n    df_custom['P_inter'] = df_custom['P_inter'].map(x =&gt; -Math.log10(1.001 - x))\n    df_custom['P_intra'] = df_custom['P_inter'].map(x =&gt; -Math.log10(1.001 - x))\n    \n    for (var f of fluxes)         \n        df_custom[f] = df_custom[f].map(x =&gt; Math.log10(x))\n                \n    df_custom['sigma'] = df_custom['sigma'].map(x =&gt; Math.log10(x))\n        \n    var feat_x = features[sel_x.active]\n    \n    for (var b of buttons_y) \n        if (b.active != null)\n            var feat_y = b.name \n     \n    df_custom['x'] = df_custom[feat_x]\n    df_custom['y'] = df_custom[feat_y]\n    \n    df_custom['color'] = []\n    \n    for (var x of df_custom['Class']) {\n\n        if (colors_dict[x])\n            df_custom['color'].push(colors_dict[x])\n        else    \n            df_custom['color'].push('black')\n     }       \n    \n    df_custom['line_color'] = Array(len).fill('black')\n    df_custom['size'] = Array(len).fill(15)\n    \n    //window.df_custom = df_custom\n    \n    //console.log(window.df_custom)\n                                  \n    var r = {}\n    \n    for (const [k, v] of Object.entries(df_custom)) { \n    \n        //var klas = v['Class']\n    \n        var b = df_custom[k]\n    \n        var c = new Array()            \n        for (var i of b)\n            c.push(i)   \n        \n        r[k] = c\n    \n    }    \n    \n    sources['custom'].data = r    \n        \n    sources['custom'].change.emit() \n                   \n    //obj = Object.entries(obj)    \n    //let obj_dict = Object.assign({}, ...obj.map((x) =&gt; ({[x[0]]: x[1:]}))) \n    //const obj2 = Object.fromEntries(obj[:,0].map((key, index)=&gt; [key, obj[index, 1:]))\n    \n"},"id":"4905","type":"CustomJS"},{"attributes":{"args":{"p":
